export default function ratesWidth(){if(document.querySelector(".block_table")||null){var e=document.querySelector(".table_name").offsetWidth,e=(document.querySelector(".block_table-options").style.marginLeft=e+"px",document.querySelectorAll(".table_value"));let o=document.querySelectorAll(".options_items .item"),l=document.querySelectorAll(".options_items .item_month"),r=document.querySelectorAll(".options_items");e.forEach(e=>{let t=e.offsetWidth;o.forEach(e=>{e.style.width=2*t+"px"}),l.forEach(e=>{e.style.width=t+"px"}),r.forEach(e=>{e.style.width=6*t+"px"})})}}